import Header from './Header';
import Footer from './Footer';

class Layout extends React.Component{

    componentDidMount(){
        fetch(CONTACT_US)
            .then(response => response.json())
            .then((data) =>
                this.setState({
                    contacts: data.results,
                })
            )
    }


    render() {

        return (
            <section>
                <Header/>
                    {this.props.children}
                <Footer/>
            </section>
        );
    }
}

export default Layout;
